import React, { useEffect } from "react";
import { useLocation } from "react-router-dom";

const UpdateUser = () => {
  const location = useLocation;

  useEffect(() => {
    console.log(location);
  }, []);

  return (
    <div className="bg-zinc-400 h-screen flex justify-center items-center">
      <div className="bg-white rounded-lg shadow-black/30 h-96 pl-10 space-y-3 w-[450px] flex flex-col justify-center">
        <div className="flex items-center justify-between bg-white-400 border-solid border-2 border-black rounded-lg mr-10 mb-20 p-4">
          <h1>First Name:</h1>
          <br />
          <input
            placeholder="First Name"
            className=" outline-none h-10 px-5 border border-sm w-full"
          />
        </div>
      </div>
    </div>
  );
};

export default UpdateUser;
